import React from "react";
import './App.scss';

import { Header } from "./Header";
import { Footer } from "./Footer";

export class Root extends React.Component {
    render() {
        return (
            <div className="homepage">
                <Header />
                {this.props.children}
                <Footer />
            </div>
        );
    }
}
